import {video} from './video.js';
import {fetchData,place} from './geocode-data.js';
import {showNotification} from'./show-notification.js';

export const btnsnapCpture  = document.querySelector('#snapCapture');
export const ul_li_img      = document.querySelector('.ul-captuers');
  //const btnDownload = document.querySelector('.button-download');
export const msgBfrUl       = document.querySelector('.message-ul');
export let latitude         = '',
            longitude       = '';
export const captures       = [];
        let count            = 1;
        let picData ;
export const takePic = () => {
  const status        = document.querySelector('#status');
  const canvas        = document.querySelector('#canvas'); 
  let dateFormat     = getDate();

  if(!navigator.geolocation) {
    status.textContent = 'Geolocation is not supported by your browser';
  } else {
    //status.textContent = 'Locating…';
      navigator.geolocation.getCurrentPosition(
        (position)=>{
            latitude  = position.coords.latitude;
            longitude = position.coords.longitude;
            canvas.getContext("2d").drawImage(video, 0, 0, 240, 180);
            let imgUrl = canvas.toDataURL("image/png");
            captures.push(imgUrl);

           // let picData ;
            picData = captures.map(item => {
                let obj = {
                  "id"        : count++,
                  "latitude"  :latitude.toFixed(2),
                  "longitude" :longitude.toFixed(2),
                  "time"      : dateFormat,
                  "src"       : item
                };
              return obj;
            });
            picData = [...picData];
            loopSrcPIc(picData);
            Storage.savePictures(picData);
            Storage.getPictures();
      }, 
      (error)=>{
          msgBfrUl.textContent = 'Unable to retrieve your location';
      });
  }
}

btnsnapCpture.addEventListener('click',takePic);//Take pic:s

export function loopSrcPIc (capturesII){
    if(!capturesII){
        capturesII  = Storage.getPictures();
      }
        
  try {
    ul_li_img.innerHTML ='';
  let srcNote ='';
    capturesII.forEach(i => { // iterate over the element
        let id = getUnikToken();// generate and set id
        let liElm = document.createElement("LI");
            liElm.setAttribute('class','remove-by-click');
            liElm.setAttribute('id',id);

        let imgLI = document.createElement("img");
            imgLI.setAttribute('src',i.src);
            imgLI.setAttribute('class','download-img');
            imgLI.setAttribute('id',id);
            imgLI.setAttribute('height',80);
            imgLI.setAttribute('crossOrigin','Anonymous');
        let link = document.createElement('a');
            link.setAttribute('id',id);
            link.innerHTML = '<span class="dwn-img-png"></span>';
            link.addEventListener('click', function(ev) {
              link.href = canvas.toDataURL();
              link.download = "download-foto.png"; 
            }, false);

        let myLink      = liElm.appendChild(link);
        let allEl       = liElm.appendChild(imgLI);
        let downLinkImg = liElm.appendChild(myLink);
          ul_li_img.append(allEl);
          ul_li_img.append(downLinkImg);
          srcNote = i.src;
    });
      showNotification(srcNote);//Notification: be informed 
      pressBtnToRemove();//remove bild on click in UI -func.
  } catch (error) {
    msgBfrUl.textContent = "Start take a pic! " + error;
  }
}
  const pressBtnToRemove = ()=> { 
      btnAddEvenListner(ul_li_img);
    }
  const btnAddEvenListner=(items)=>{ 
    items.addEventListener('click', (e) => {
        removeObj(e);
    });
  }
  const removeObj = (e)=> { 
    e.path[2].remove();
    Storage.removeLocalPics(e.path[0].src);
    Storage.getPictures();
    location.reload();
  }

  //get unik id method
  const getUnikToken = ()=>{
    return Math.random().toString(36).substring(2, 15) + Math.random().toString(36).substring(2, 15);
  }
  const getDate = ()=>{
    let _date = Date();  
    return _date.toString().substring(0,24);
  }

  //local Storage
  export class Storage{

    static clearLocalPictures(){
      localStorage.clear();
    }
    static removeLocalPics(evt) {
      //console.log('Evt remove -localstorage' ,evt);
      let updatedGetPictures = Storage.getPictures().filter(item => item.src !== evt);
      console.log('updatedGetPictures... : ', updatedGetPictures);
      Storage.savePictures(updatedGetPictures);
      Storage.getPictures();
      //location.reload();
    }
    static savePictures(captures){
      localStorage.setItem("captures",JSON.stringify(captures));
    }
    static getPictures(){
      return localStorage.getItem('captures') ? JSON.parse(localStorage.getItem('captures')):[
        {id: 36, place: "Oxxxgatan , Göteborg", time: "Fri Nov 27 2020 11:50:30", src: "data:image/jpeg;base64,"},{id: 36, place: "Xxxxgatan , Göteborg", time: "Fri Nov 27 2020 11:50:32", src: "data:image/jpeg;base64,"}];
    }
    
  }